import React from 'react';
import './Logo.css'

const Logo = () => {
    return (
        <div>
            <h1 className='logo__title'>
                <span className='logo__title-first'>F</span><span>ilip</span>
                <span className='logo__title-first'>Z</span><span>akrocki</span>
                <span className='logo__title-first'>L</span><span>anding</span>
                <span className='logo__title-first'>P</span><span>age</span>
            </h1>          
        </div>
    );
}

export default Logo;
